import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-f05d3ed8.js";const o={},c=t("<p>《三命通会》卷 九·六辛日丁酉时断</p><p>六辛日生时丁酉，鬼破禄无祸百端；</p><p>倚托身强方断吉，月通制伏是偏官。</p><p>辛日丁酉时，火金持争。</p><p>辛金酉上健旺，见丁为正鬼；酉上丁长生，破禄，不成其福，反复成败。</p><p>身强通月气有制伏者，作偏官论；更行身旺运，贵。</p><p>通金气无丁，身强，行南运，大贵。</p><p>辛丑日丁酉时，高平稳。</p><p>酉月、土木运，方面。</p><p>戌亥子巳未年月，大贵。</p><p>辛卯日丁酉时，时日并冲。</p><p>月通金气，不透丙丁，南方运，贵。</p><p>辛巳日丁酉时，平。</p><p>亥月，反复不定。</p><p>午月，偏官带疾，显达寿促。</p><p>子月，贵戚。</p><p>一云有财有喜，寿不过三十一。</p><p>辛未日丁酉时，不贵则富。</p><p>月通金气，无丙丁字，行南运，贵。</p><p>辛酉日丁酉时，年月通金气，吉。</p><p>丑月，西方运，风宪。</p><p>寅午戌，贵。</p><p>辛亥日丁酉时，贵。</p><p>丑寅卯酉年月；近待、金紫。</p><p>酉时辛日等同论，出户相迎喜事新；不遇刑冲空克破，何愁富贵不加身。</p><p>辛日时临丁酉，偏官合局相投。</p><p>丙、丁重见主淹留，嗣息女多男少。</p><p>祖业残花秋暮，游人皎月云收。</p><p>身强官旺福优游，运至财官大有。</p>",29),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","260卷 九·六辛日丁酉时断.html.vue"]]);export{f as default};
